    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1609185015428,"commentText":"<div>In this program I will calculate the weekly pay for an hourly employee. At \nfirst I will 'hard code' the values for the variables right in the \nprogram source code. <br></div><div><br></div><div>This is not convenient for most users, however, \nbecause if they want to put in different values for different employees \nthey must be able to read the code to alter it. This can be daunting for\n most. Next, I will change the program so that a user of the program can\n enter in those values without having to edit or understand the code.</div><div><br></div><div>We have already seen that we can print values to the screen with <font face=\"Courier\">cout</font><b>&nbsp;</b>(pronounced '<i>see-out</i>'). There is another mechanism called <font face=\"Courier\">cin</font> (pronounced '<i>see-in</i>') that reads values from the keyboard into the variables in our program.</div>","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-87":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-87","timestamp":1503885723341,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":87,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-86","lineNumber":7,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185046050,"commentText":"The first step in any program is to think about the problem and try to discover what data is required to solve it. This is a payroll program so I think I may need the number of hours worked and the hourly pay rate. I probably need the employee's name too.&nbsp;<div><br></div><div>Finally, I need to calculate the weekly pay. I think I should have a variable that exists just to hold the result of the payroll calculation so that I can print it at the end. So, I'll build up from my boilerplate code and start with by creating some variables.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"int main() \n{ \n     \n    return 0; \n}","startRow":4,"startColumn":0,"endRow":8,"endColumn":1}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"int main() \n{ \n     \n    return 0; \n}","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-213":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-213","timestamp":1503885776807,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":213,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-212","lineNumber":2,"column":19,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185092244,"commentText":"I am using <font face=\"Courier\">floats</font> for the numeric variables because I know sometimes people work more/less than whole hours (40.5) and make more/less than whole dollars per hour ($15.25).<div><br></div><div>I won't be doing any mathematical computation on the name variable, it is simply a <font face=\"Courier\">string</font>.</div><div><br></div><div>Once I figure out how to calculate the weekly pay I will store it in <font face=\"Courier\">weeklyPay</font> so that I can print it at the end of the program. The highlighted code shows the variable declarations for this data.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"float numHoursWorked; \n    float hourlyPayrate; \n    string employeeName; \n    float weeklyPay;","startRow":7,"startColumn":4,"endRow":10,"endColumn":20}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"3","currentFilePath":"/salary.cpp","viewableBlogText":"int main() \n{ \n    float numHoursWorked; \n    float hourlyPayrate; \n    string employeeName; \n    float weeklyPay; \n \n    return 0; \n}","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-329":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-329","timestamp":1503885830162,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":329,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-328","lineNumber":16,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608056303731,"commentText":"In this first version of the program I am going to 'hard code' the values for the variables in the code. This means the values will come from the programmer who is writing the program and not necessarily the person who will use the program.<br><div><br></div><div>If someone using the program (who isn't a programmer) wants to calculate pay for a different employee they would have to know where to find this source code file, know which variables to edit, and how to recompile the program. This is not realistic for most users of computers. I will change the way this works in a bit.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"numHoursWorked = 40.0; \n    hourlyPayrate = 10.0; \n    employeeName = \"Mark M.\";","startRow":12,"startColumn":4,"endRow":14,"endColumn":29}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"7","linesBelow":"3","currentFilePath":"/salary.cpp","viewableBlogText":"int main() \n{ \n    float numHoursWorked; \n    float hourlyPayrate; \n    string employeeName; \n    float weeklyPay; \n \n    numHoursWorked = 40.0; \n    hourlyPayrate = 10.0; \n    employeeName = \"Mark M.\"; \n     \n    return 0; \n}","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-400":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-400","timestamp":1503885845114,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":400,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-399","lineNumber":18,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185742176,"commentText":"The weekly pay calculation is pretty simple if we know how long the person worked and how much they earn per hour. I store the result in a variable called <font face=\"Courier\">weeklyPay</font> so that I can use it later.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"weeklyPay = numHoursWorked * hourlyPayrate;","startRow":16,"startColumn":4,"endRow":16,"endColumn":47}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    numHoursWorked = 40.0; \n    hourlyPayrate = 10.0; \n    employeeName = \"Mark M.\"; \n \n    weeklyPay = numHoursWorked * hourlyPayrate; ","commentTags":["question"],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"False","question":"Most people earn extra pay when they work more than 40 hours. True or false, in this program, if the number of hours worked is more than 40 the overtime calculation will be done automatically by the computer?","explanation":""},"commentTitle":""}],"ev-475":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-475","timestamp":1503885880731,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":475,"type":"INSERT","fileId":"fileId-0","character":" ","previousNeighborId":"ev-474","lineNumber":20,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608054044316,"commentText":"Next, I print the name and how much the person earned. The attached screenshot shows the result.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cout<<employeeName<<\" earned $\"<<weeklyPay<<endl;","startRow":18,"startColumn":4,"endRow":18,"endColumn":53}],"imageURLs":["media/images/1608054030633-Screen Shot 2020-12-15 at 11.39.52 AM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"6","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    numHoursWorked = 40.0; \n    hourlyPayrate = 10.0; \n    employeeName = \"Mark M.\"; \n \n    weeklyPay = numHoursWorked * hourlyPayrate; \n \n    cout<<employeeName<<\" earned $\"<<weeklyPay<<endl; ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-629":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-629","timestamp":1503887329694,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":629,"type":"INSERT","fileId":"fileId-0","character":"t","previousNeighborId":"ev-628","lineNumber":22,"column":27,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185206113,"commentText":"<div>Next, I will remove the hard coded values from the code and ask the user to supply them by typing with their keyboard. <font face=\"Courier\"><br></font></div><div><font face=\"Courier\"><br></font></div><div><font face=\"Courier\">cin</font> (which is part of the <font face=\"Courier\">iostream</font> library along with <font face=\"Courier\">cout</font>) reads in from the keyboard and stores values inside variables.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"numHoursWorked = 40.0; \n    hourlyPayrate = 10.0; \n    employeeName = \"Mark M.\";","startRow":14,"startColumn":4,"endRow":16,"endColumn":29}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    //assigning values to the variables \n    numHoursWorked = 40.0; \n    hourlyPayrate = 10.0; \n    employeeName = \"Mark M.\"; ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-866":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-866","timestamp":1503887413850,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":866,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-865","lineNumber":16,"column":24,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185243615,"commentText":"<div>In order to let the user know what I am asking them to enter I always begin by prompting them to enter in a specific piece of data. With this <font face=\"Courier\">cout</font> I am saying to the user of the program that I expect them to enter in the number of hours worked.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cout<<\"Enter in the number of hours worked: \";","startRow":14,"startColumn":4,"endRow":14,"endColumn":50}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"1","currentFilePath":"/salary.cpp","viewableBlogText":"    //prompt the user for the values \n    cout<<\"Enter in the number of hours worked: \"; \n    cin>>numHoursWorked; ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-9","displayCommentEvent":{"id":"ev-866","timestamp":1503887413850,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":866,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-865","lineNumber":16,"column":24,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185272122,"commentText":"When the flow of control reaches line 16 with the <font face=\"Courier\">cin</font> the program pauses. It waits for the user to type something in at the keyboard and then hit the 'enter/return' key.<div><br></div><div>As soon as that happens the program goes back to running at full speed and the last value entered in the keyboard is stored inside the variable after the <font face=\"Courier\">&gt;&gt;</font>.&nbsp;</div><div><br></div><div>In this case whatever number the user enters is placed in the variable called <font face=\"Courier\">numHoursWorked</font>.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cin>>numHoursWorked;","startRow":15,"startColumn":4,"endRow":15,"endColumn":24}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    //prompt the user for the values \n    cout<<\"Enter in the number of hours worked: \"; \n    cin>>numHoursWorked; ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-953":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-953","timestamp":1503887439529,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":953,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-952","lineNumber":19,"column":23,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185293910,"commentText":"<div>Next, I'll gather the pay rate from the user of the program.<br></div><div><br></div><div>Again, the program will pause and wait for the user to enter in a value and then hit the 'enter/return' key. That value will be stored in the variable named <font face=\"Courier\">hourlyPayrate</font>.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cout<<\"Enter in the hourly pay rate: $\"; \n    cin>>hourlyPayrate;","startRow":17,"startColumn":4,"endRow":18,"endColumn":23}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    cout<<\"Enter in the hourly pay rate: $\"; \n    cin>>hourlyPayrate; ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-1038":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-1038","timestamp":1503887463079,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1038,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-1037","lineNumber":22,"column":22,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185325047,"commentText":"Lastly, I'll ask for the name. This pauses the program until the user enters one in. After the user enters in a name and hits the 'enter/return' key the program will resume. Then the weekly pay will be calculated and the results will be shown on the screen.<div><br></div><div>Look at the attached screenshot to trace how I entered in the data. Then look at the output (you might notice a problem with the final output).</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cout<<\"Enter in the employee name: \"; \n    cin>>employeeName;","startRow":20,"startColumn":4,"endRow":21,"endColumn":22}],"imageURLs":["media/images/1608054413045-Screen Shot 2020-12-15 at 11.46.44 AM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    cout<<\"Enter in the employee name: \"; \n    cin>>employeeName; ","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-13","displayCommentEvent":{"id":"ev-1038","timestamp":1503887463079,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1038,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-1037","lineNumber":22,"column":22,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185408615,"commentText":"Did you find the error in the output? If you look at the user input and compare it with the output you will notice that I entered in the name <font face=\"Courier\">Mark M<i>.</i></font> but the output showed my name simply as <font face=\"Courier\">Mark</font><i>.</i>&nbsp;<div><br></div><div>The reason for this has to do with <i>streams</i>. <font face=\"Courier\">cin</font> and <font face=\"Courier\">cout</font> are input and output streams to your program. You can think of there being a (metaphorical) stream of characters flowing into the program from the keyboard (<font face=\"Courier\">cin</font>) and a stream of characters flowing out of the program to the monitor (<font face=\"Courier\">cout</font>). See the attached picture.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cin","startRow":15,"startColumn":4,"endRow":15,"endColumn":7},{"fileId":"fileId-0","selectedText":"cin","startRow":18,"startColumn":4,"endRow":18,"endColumn":7},{"fileId":"fileId-0","selectedText":"cin","startRow":21,"startColumn":4,"endRow":21,"endColumn":7}],"imageURLs":["media/images/1608054723053-01.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    //prompt the user for the values \n    cout<<\"Enter in the number of hours worked: \"; \n    cin>>numHoursWorked; \n \n    cout<<\"Enter in the hourly pay rate: $\"; \n    cin>>hourlyPayrate; \n \n    cout<<\"Enter in the employee name: \"; \n    cin>>employeeName; ","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-14","displayCommentEvent":{"id":"ev-1038","timestamp":1503887463079,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1038,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-1037","lineNumber":22,"column":22,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185428178,"commentText":"<div>When I use <font face=\"Courier\">cout</font> I am sending some data from my program through the stream to be displayed on the monitor.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cout<<employeeName","startRow":27,"startColumn":4,"endRow":27,"endColumn":22}],"imageURLs":["media/images/1608054779071-02.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    //displaying the result \n    cout<<employeeName<<\" earned $\"<<weeklyPay<<endl; ","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-15","displayCommentEvent":{"id":"ev-1038","timestamp":1503887463079,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1038,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-1037","lineNumber":22,"column":22,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185449694,"commentText":"<div>When I use <font face=\"Courier\">cin</font> I am receiving a group of characters that have been buffered from the keyboard. When the user hits the 'enter/return' key the buffered characters are turned into a single piece of data and stored in a variable.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cin>>employeeName;","startRow":21,"startColumn":4,"endRow":21,"endColumn":22}],"imageURLs":["media/images/1608055046502-03.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    cout<<\"Enter in the employee name: \"; \n    cin>>employeeName; ","commentTags":["image"],"questionCommentData":null,"commentTitle":""},{"id":"commentId-16","displayCommentEvent":{"id":"ev-1038","timestamp":1503887463079,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1038,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-1037","lineNumber":22,"column":22,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185491272,"commentText":"Characters from the keyboard are grouped together. Each group of characters is separated from other groups with either the 'enter/return' key <i>or</i> a space.&nbsp;<div><br></div><div>Since <font face=\"Courier\">Mark M.</font> has a space in it the program will attempt to turn this into two separate pieces of data to be used in two separate <font face=\"Courier\">cin</font>'s. The program received the first part, <font face=\"Courier\">Mark</font>, in <font face=\"Courier\">employeeName</font> from the <font face=\"Courier\">cin</font> on line 22 but it did not get the last part because there was not another <font face=\"Courier\">cin</font> statement.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cin>>employeeName;","startRow":21,"startColumn":4,"endRow":21,"endColumn":22}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    cout<<\"Enter in the employee name: \"; \n    cin>>employeeName; ","commentTags":[],"questionCommentData":null,"commentTitle":""},{"id":"commentId-17","displayCommentEvent":{"id":"ev-1038","timestamp":1503887463079,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1038,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-1037","lineNumber":22,"column":22,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608057202900,"commentText":"Both the 'enter/return' key and the space are considered 'whitespace characters'.<font face=\"Courier\"> cin</font> groups characters around one or more whitespace characters.<div><br></div><div>Then, the type of the variable used in the <font face=\"Courier\">cin</font> is examined and the program attempts to turn the characters into a value of that type.</div><div><br></div><div>The attached picture shows how the stream of characters is turned into data:<br></div><div>'4' '0' was turned into <font face=\"Courier\">float</font> 40.0</div><div>'1' '0' '.' '0' '0' was turned into <font face=\"Courier\">float</font> 10.0</div><div>'M' 'a' 'r' 'k' was turned into the <font face=\"Courier\">string</font> \"Mark\"</div><div>'M' '.' if it had been read in, would have been turned into the <font face=\"Courier\">string</font> \"M.\"</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cin>>employeeName;","startRow":21,"startColumn":4,"endRow":21,"endColumn":22}],"imageURLs":["media/images/1608055349525-04.jpeg"],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    cout<<\"Enter in the employee name: \"; \n    cin>>employeeName; ","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-1182":[{"id":"commentId-18","displayCommentEvent":{"id":"ev-1182","timestamp":1503890134135,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1182,"type":"INSERT","fileId":"fileId-0","character":"t","previousNeighborId":"ev-1181","lineNumber":26,"column":21,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185874322,"commentText":"<div>I will solve this problem by asking for a first and last name separately. I start by changing my variables. I'll have a <font face=\"Courier\">string</font> for the first name and another <font face=\"Courier\">string</font> for the last name.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"string employeeFirstName; \n    string employeeLastName;","startRow":10,"startColumn":4,"endRow":11,"endColumn":28}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"1","currentFilePath":"/salary.cpp","viewableBlogText":"    float numHoursWorked; \n    float hourlyPayrate; \n    string employeeFirstName; \n    string employeeLastName; \n    float weeklyPay; ","commentTags":["question"],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"False","question":"True or false, it is likely that you will discover all of your variables at the beginning of a coding session and never need to go back and add or remove old ones?","explanation":""},"commentTitle":""},{"id":"commentId-20","displayCommentEvent":{"timestamp":1503890134135,"type":"INSERT","eventSequenceNumber":1182,"createdByDevGroupId":"devGroupId-2","id":"ev-1182","fileId":"fileId-0","character":"t","previousNeighborId":"ev-1181","lineNumber":26,"column":21,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609185591908,"commentText":"<div><div>Then I prompt for and store the first and last name from the user of the program. I realize this is a little unusual... it is possible that a first or last name could have a space in it.</div><div><br></div><div>This\n is a peculiarity of command line programs in C++. There are \nalternatives to command line programs. It is possible to create programs with windows and buttons and drop down lists in C++ and I hope that you do that one day. To keep things as simple as possible, however, I am going to use command line programs for all of my examples in this book.</div></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cin>>employeeFirstName;","startRow":22,"startColumn":4,"endRow":22,"endColumn":27},{"fileId":"fileId-0","selectedText":"cin>>employeeLastName;","startRow":25,"startColumn":4,"endRow":25,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"1","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    cout<<\"Enter in the employee's first name: \"; \n    cin>>employeeFirstName; \n \n    cout<<\"Enter in the employee's last name: \"; \n    cin>>employeeLastName; ","commentTags":[],"questionCommentData":null,"commentTitle":""}],"ev-1222":[{"id":"commentId-19","displayCommentEvent":{"id":"ev-1222","timestamp":1503890154705,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":1222,"type":"DELETE","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-1221","lineNumber":32,"column":54},"developerGroupId":"devGroupId-2","timestamp":1609186023340,"commentText":"Now, each group of characters is converted and stored into separate name variables. The new output is shown in the attached screenshot.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"cout<<employeeFirstName<<\" \"<<employeeLastName<<\" earned $\"<<weeklyPay<<endl;","startRow":31,"startColumn":4,"endRow":31,"endColumn":81}],"imageURLs":["media/images/1608055856495-Screen Shot 2020-12-15 at 12.10.18 PM.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"0","currentFilePath":"/salary.cpp","viewableBlogText":"    //calculating the weekly pay \n    weeklyPay = numHoursWorked * hourlyPayrate; \n \n    //displaying the result \n    cout<<employeeFirstName<<\" \"<<employeeLastName<<\" earned $\"<<weeklyPay<<endl; ","commentTags":["question","image"],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"False","question":"True or false, it would be perfectly fine to swap lines 29 and 32 and the program would work exactly the same as before?","explanation":""},"commentTitle":""}]};
